/* eslint-disable no-trailing-spaces */
/* eslint-disable no-unused-vars */
import React from 'react'
import { motion } from 'framer-motion'

function Landing () {
  const variants = {
    visibleX: {
      x: 0,
      transition: {
        when: 'beforeChildren',
        // staggerChildren: 3,
        type: 'spring',
        damping: 15
      }
    },

    visibleY: {
      y: 0,
      transition: {
        delay: 0.7,
        type: 'spring',
        damping: 15
      },

      fadeIN: {
        opacity: 0,
      }
    }
  }
  return (
    <motion.div className='landingContainer'
      initial={{ x: -10000 }}
      variants={variants}
      animate='visibleX'
    >
      <motion.div className='landingTop'
      >
      </motion.div>

      <motion.div className='landingBottom'
      >
      </motion.div>
      <div>
        <h1 className='landingTitle'>Repertoire</h1>
      </div>
      <motion.div className='contentContainer'
        initial={{ y: -1000 }}
        variants={variants}
        animate='visibleY'
      >
        <div className='landingAlbums'>
          <div className='landingAlbum1'>
            <img src={require('../assets/caprisongs.jpeg')} className='albumImg'></img>
          </div>
          <div className='landingAlbum2'>
            <img src={require('../assets/phantasies.jpeg')} className='albumImg'></img>
          </div>
          <div className='landingAlbum3'>
            <img src={require('../assets/small-things.jpeg')} className='albumImg'></img>
          </div>
          <div className='landingAlbum4'>
            <img src={require('../assets/james_blake.jpeg')} className='albumImg'></img>
          </div>
        </div>

        <div className='landingBreaker'></div>

        <div className='breakerRight'>
          <h2 className='landingHeader'>Music Recommendation Made Easy.</h2>
          <h3 className='landingText'>Recommend, Chat About, And Rate the Music You And Your Friends Are Currently Listening To.</h3>
          <motion.button className='signIn'
            whileTap={{ scale: 0.9 }}
          >
            <p>Sign In</p>
          </motion.button>
        </div>
      </motion.div>
    </motion.div>
  )
}

export default Landing
